--- VALID_PROTO_ACTION_CORESP
TRUNCATE TABLE VALID_PROTO_ACTION_CORESP
/
commit
/
UPDATE_TIMESTAMP,	UPDATE_USER,	FINAL_FLAG,	VER_NBR,	OBJ_ID)
SELECT 	(select max(VALID_PROTO_ACTION_CORESP_ID) from VALID_PROTO_ACTION_CORESP )+ rownum VALID_PROTO_ACTION_CORESP_ID,
t1.PROTOCOL_ACTION_TYPE_CODE,	t1.PROTO_CORRESP_TYPE_CODE,	t1.UPDATE_TIMESTAMP,	t1.UPDATE_USER,
t1.FINAL_FLAG,	1,	SYS_GUID()
FROM OSP$VALID_PROTO_ACTION_CORESP@coeus.kuali t1
LEFT OUTER JOIN VALID_PROTO_ACTION_CORESP t2 on t1.PROTOCOL_ACTION_TYPE_CODE = t2.PROTOCOL_ACTION_TYPE_CODE
AND t1.PROTO_CORRESP_TYPE_CODE = t2.PROTO_CORRESP_TYPE_CODE
WHERE t2.PROTOCOL_ACTION_TYPE_CODE IS null
/
commit
/
--  VALID_PROTO_ACTION_ACTION
TRUNCATE TABLE VALID_PROTO_ACTION_ACTION
/
commit
/
FOLLOWUP_ACTION_CODE,USER_PROMPT_FLAG,USER_PROMPT,UPDATE_TIMESTAMP,UPDATE_USER,OBJ_ID,COMM_DECISION_MOTION_TYPE_CODE)
select
( select max(VALID_PROTO_ACTION_ACTION_ID) from VALID_PROTO_ACTION_ACTION ) + rownum AS VALID_PROTO_ACTION_ACTION_ID,
t1.PROTOCOL_ACTION_TYPE_CODE, t1.ACTION_NUMBER, t1.FOLLOWUP_ACTION_CODE, t1.USER_PROMPT_FLAG, t1.USER_PROMPT,
t1. UPDATE_TIMESTAMP, t1.UPDATE_USER,SYS_GUID(),
decode(t1.FOLLOWUP_ACTION_CODE,202,4,203,3,204,1,304,2,1) COMM_DECISION_MOTION_TYPE_CODE
from OSP$VALID_PROTO_ACTION_ACTION@coeus.kuali t1
LEFT OUTER JOIN VALID_PROTO_ACTION_ACTION t2 on t1.PROTOCOL_ACTION_TYPE_CODE = t2.PROTOCOL_ACTION_TYPE_CODE
AND t1.ACTION_NUMBER = t2.ACTION_NUMBER AND t1.FOLLOWUP_ACTION_CODE = t2.FOLLOWUP_ACTION_CODE
WHERE t2.PROTOCOL_ACTION_TYPE_CODE IS NULL
/
commit
/
